import React, { Component } from 'react'

export default class MessageList extends Component {
    render() {
        return (
            <ul>
                {this.props.messages.map((message, index)=>{
                    <li key={index}>
                        <p>{message.senderId}</p>
                        <h3>{message.text}</h3>
                    </li>
                })}
            </ul>
        )
    }
}
